package HW2;

public class Tablereview {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
         int start=1;
         int end=5;
         
         while(start<=100) {
        	int result = start*end;
        	System.out.println(end+"X"+start+"="+result);
        	start++;
         }
	}

}
